How to pass 2 parameters to a GET request using retrofit?<p>The normal <code>GET</code> request doesn't have any arguments, right? It just fetches the whole data. The thing is: I need to fetch the Salons that are closer to a given coordinate point (lat/lng) and that's why I need to pass 2 parameters to the <code>GET</code> request ( <code>express js</code> ).</p>

<p>I'm using <strong>NODE JS</strong>, <strong>EXPRESS JS</strong>, <strong>MONGO DB</strong>.
In frontend, I'm using <strong>Android Studio</strong> and coding with <strong>KOTLIN</strong>.</p>

<p>The following code is the interface (frontend/kotlin):</p>

<p><div class="snippet" data-lang="js" data-hide="false" data-console="true" data-babel="false">
<div class="snippet-code">
<pre class="snippet-code-html lang-html prettyprint-override"><code>    @GET("/salao")
    fun getAllSaloes(@Query("lat") lat: Float,
                     @Query("lon") lon: Float): Call&lt;salaoList&gt;</code></pre>
</div>
</div>
</p>

<p>and the following code is the backend code (express js):</p>

<p><div class="snippet" data-lang="js" data-hide="false" data-console="true" data-babel="false">
<div class="snippet-code">
<pre class="snippet-code-js lang-js prettyprint-override"><code>    app.get('/salao/:lat/:lon', (req,res) =&gt; {
      var lat = req.params.lat;
      var lon = req.params.lon;

      Salao.find({
        "loc": {
            $near: {
              $geometry: {
                 type: "Point",
                 coordinates: [ lat, lon ] // Latitude - Longitude

              },
            }
          }
      }).then((saloes) =&gt; {
          console.log("Getting the closer salons...");
          res.send({saloes})
      },(e) =&gt; {
          res.status(400).send(e);
      });
    });</code></pre>
</div>
</div>
</p>

<p>One important point: If I do not pass any parameter and only do a normal query and use lat-lng hardcoded (ex: -44.41241, -22.412412) it works.</p>

<p>The problem is on passing 2 parameters.</p>

<p>How can I solve it?</p>

<p>Thanks!</p>

